Hindwing (
Fig. 26
): mostly hyaline, costal space washed with yellow and very slightly opaque; costal margin slightly convex at midlength immediately preceding shallow concavity; costa joins subcosta at approximately four-fifths wing length; no crossveins in proximal half of costal space, 5–8 (
10
