10
) crossveins throughout subcostal space. Abdomen (
Fig. 27
): light to tan brown with darker brown markings, dark brown diamond shaped maculae forming central stripe on segments two to nine, flanked by golden markings anteriorly and posteriorly on each segment, segments one and ten predominantly brown. Genitalia (
Figs 28–31
): forceps three segmented (
Fig. 28
); tan brown, progressively lighter apically, terminal segment angular, about the same length as middle segment; penes golden brown, fused along entire length dorsally (
Figs 28 & 29
